        mHdltvoutHandle << " , " <<  " \"interrupt\" :  \"" << interrupt.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"input_V_V_TDATA\" :  \"" << input_V_V_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_V_V_TDATA\" :  \"" << output_V_V_TDATA.read() << "\" ";
